CapVolGraph.prototype.initCharts = function (seriesData) {
    var that = this;
    Highcharts.setOptions({
        global: { useUTC: false },
        lang: {
            downloadJPEG: "下载jpg",
            downloadPDF: '下载pdf',
            downloadPNG: '下载png',
            downloadSVG: '下载svg',
            loading: '加载中...',
            months: ['1月', '2月', '3月', '4月', '5月', '6月', '7月', '8月', '9月', '10月', '11月', '12月'],
            printChart: '打印图表',
            shortMonths: ['1月', '2月', '3月', '4月', '5月', '6月', '7月', '8月', '9月', '10月', '11月', '12月'],
            rangeSelectorFrom: "从",
            rangeSelectorTo: "到",
            rangeSelectorZoom: "缩放",
            resetZoom: "恢复初始缩放等级",
            resetZoomTitle: " 1:1缩放等级",
            shortWeekdays: ['周日', '周一', '周二', '周三', '周四', '周五', '周六'],
            weekdays: ['周日', '周一', '周二', '周三', '周四', '周五', '周六'],
            numericSymbols: ["千", "百万", '十亿'],
            thousandsSep: ","
        }
    });
    var dataType = $('#' + that.graphId).data("value");
    var titleName = "全球数字货币总市值走势图";
    if (dataType == "1") {
        titleName = titleName+"(比特币Btc除外)";
    }

    $('#' + that.graphId).highcharts('StockChart', {
        chart: { type: 'line', zoomType: is_mobile() ? 'null' : 'x', height: 520, ignoreHiddenSeries: true },
        tooltip: { shared: true, hideDelay: 50, xDateFormat: '%A, %b %d %Y, %H:%M:%S' },
        legend: {
            enabled: true,
            align: 'center',
            backgroundColor: '#FFFFFF',
            borderColor: 'black',
            borderWidth: 0,
            layout: 'horizontal',
            verticalAlign: 'bottom',
            y: 0,
            shadow: false,
            floating: false
        },
        navigator: { adaptToUpdatedData: false },
        scrollbar: { liveRedraw: false },
        //title: { text: titleName , align: "left", style: { fontSize: "24px" } },
        subtitle: { text: '' },
        rangeSelector: {
            allButtonsEnabled: true,
            buttons: [{ type: 'day', count: 1, text: 'd' }, { type: 'week', count: 1, text: 'w' }, {
                type: 'month',
                count: 1,
                text: 'm'
            }, { type: 'month', count: 3, text: '3m' }, { type: 'year', count: 1, text: 'y' }, {
                type: 'ytd',
                count: 1,
                text: 'YTD'
            }, { type: 'all', text: 'all' }],
            selected: 6, 
            enabled: true
        },
        xAxis: [{
            events: {
                afterSetExtremes: function (e) {
                    that.afterSetExtremes(e)
                }
            }, minRange: 24 * 3600 * 1000
        }],
        yAxis: [{
            labels: {
                formatter: function () {
                    return '$' + this.axis.defaultLabelFormatter.call(this);
                }, align: 'right', style: { color: '#7cb5ec' }
            },
            title: { text: '市值', style: { color: '#7cb5ec', 'font-weight': 'bold' }  },
            showEmpty: false,
            height: '80%',
            opposite: true,
            floor: 0
        },  {
            labels: { align: 'right', style: { color: '#777', } },
            title: { text: '24h 成交量', style: { color: '#777', 'font-weight': 'bold' }, align: "left", x: -10 },
            showEmpty: false,
            top: '80%',
            height: '20%',
            offset: 2,
            lineWidth: 1,
            opposite: true
        }],
        series: [{
            name: '市值',
            color: '#7cb5ec',
            tooltip: { pointFormatter: tooltip_format_market_cap },
            data: seriesData["market_cap_by_available_supply"], 
            dataGrouping: { enabled: false }
        }, {
            type: 'column',
            name: '24h 成交量',
            color: '#777',
            yAxis: 1,
            tooltip: { pointFormatter: tooltip_format_market_cap },
            data: seriesData["vol_usd"],
          
            dataGrouping: { approximation: "average", enabled: false }
        }],
        plotOptions: {
            series: {
                events: {
                    legendItemClick: function (event) {
                        var index = event.target.index
                        save_preferences(that.chartName, index, this.chart);
                    }
                }
            }
        },
    });
    that.hideLoading();
}

